(function () {
  var form = document.querySelector('.form');
  var send = document.querySelector('.form .form__sending .btn');
  var overlay = document.querySelector('.form-overlay');
  var closeBtn = document.querySelector('.form-overlay  button.request__close');
  var requestMessage = document.querySelector('.form-overlay .request__text');
  form.addEventListener('submit', function (e) {
    e.preventDefault();
    var data = {
      name: form.elements.name.value,
      phone: form.elements.phone.value,
      comment: form.elements.comment.value,
      to: 'nurtilex@gmail.com'
    };
    var xhr = new XMLHttpRequest();
    xhr.open('POST', 'https://webdev-api.loftschool.com/sendmail');
    xhr.setRequestHeader('content-type', 'application/json');
    xhr.send(JSON.stringify(data));
    xhr.addEventListener('load', function () {
      requestMessage.textContent = xhr.status >= 400 ? 'Отправка не получилась' : 'Сообщение отправлено';
      overlay.style.display = 'flex';
    });
  });

  function closeFormOverlay() {
    overlay.style.display = 'none';
  }

  closeBtn.onclick = function (e) {
    e.preventDefault();
    closeFormOverlay();
  };

  overlay.onclick = function () {
    return closeFormOverlay();
  };
})();

(function () {
  var buttons = Array.from(document.querySelectorAll('.reviews__slider'));
  var state = [{
    author: 'Ольга Макарова',
    title: 'Лучший дизайн',
    description: 'Я увидела доски на сайте и влюбилась в их дизайн. К летнему сезону я заказала себе доску в SurfBoard. Дизайнер команды - волшебница! Она учла все мои предпочтения и комментарии. В итоге получился прекрасный дизайн. А я катаюсь на доске, которая мне нравится)',
    imgPath: '../../../img/reviews__person-one.png'
  }, {
    author: 'Марк Брюлов',
    title: 'Нереальная скорость',
    description: 'Я занимаюсь профессиональным спортом. Доверил изготовление доски для соревнований ребятам из Surfboard и не пожалел: 1 место на соревнованиях. Нереальная скорость, устойчивая, удобная и легкая: всё что нужно для победы на соревнованиях!',
    imgPath: '../../../img/reviews__person-two.png'
  }, {
    author: 'Василий Поперечный',
    title: 'Устойчивость и безопасность',
    description: 'Я заказывал доски для своих детей. Мне было важно, чтобы они были устойчивые, так как безопасность детей на первом месте. Доски были изготовлены по индивидуальным замерам с учетом роста и веса каждого ребенка. Теперь дети катаются и им нравится!',
    imgPath: '../../../img/reviews__person-three.png'
  }];
  buttons.forEach(function (btn, i) {
    btn.addEventListener('click', function () {
      var titleEl = document.querySelector('.review__title');
      var authorEl = document.querySelector('.review__author');
      var descriptionEl = document.querySelector('.review__description');
      var pic = document.querySelector('.review__pic');
      titleEl.textContent = state[i].title;
      authorEl.textContent = state[i].author;
      descriptionEl.textContent = state[i].description;
      pic.style.backgroundImage = "url(".concat(state[i].imgPath, ")");
      buttons.forEach(function (i) {
        return i.classList.remove('reviews__slider--active');
      });
      btn.classList.add('reviews__slider--active');
    });
  });
})();

(function () {
  var open = document.querySelector('.header__burger');
  var close = document.querySelector('.close-full-nav');
  var main = document.querySelector('.wrapper');
  var fullNav = document.querySelector('.nav--full-menu');
  open.addEventListener('click', function () {
    main.style.visibility = 'hidden';
    fullNav.style.visibility = 'visible';
  });
  close.addEventListener('click', function () {
    main.style.visibility = 'visible';
    fullNav.style.visibility = 'hidden';
  });
})();

(function () {
  var prev = document.querySelector('.slider__move-btn-left');
  var next = document.querySelector('.slider__move-btn-right');
  var list = document.querySelector('.slider__list');
  var items = Array.from(document.querySelectorAll('.slide'));
  var current = 1;
  var step = 100;
  next.addEventListener('click', function () {
    if (current === 4) {
      current = -0;
    }

    items.forEach(function (el) {
      el.style.transform = "translateX(".concat(-current * 100, "%)");
      el.style.transition = '1s';
    });
    current++;
  });
  prev.addEventListener('click', function () {
    if (current === 0) {
      current = 4;
    }

    items.forEach(function (el) {
      el.style.transform = "translateX(-".concat(current * 100 - 100, "%)");
      el.style.transition = '1s';
    });
    current--;
  });
})();
